import React from "react";
import foodTypes from "../foodTypeData2"

const MenuFood = () => {
  console.log(Object.entries(foodTypes));
  return (
    <div className="menu-food">
      <ul>
      {Object.entries(foodTypes).map((item, index) => {
        return <li key={index}>{item[0]}</li>
      })}
      </ul>
      {/* <p>{Object.entries(foodTypes)[0][0]}</p>
      <p>{Object.entries(foodTypes)[1][0]}</p> */}
    </div>
  );
};

export default MenuFood;
